import React from 'react'

const SignInPage = (props) => { //it passes the Router properties from the parent comp (App.js)
    setTimeout(() => {
        props.history.push('/about')
    }, 2000)
    return (
        <div className="container">
            <h2 className="signin">
                Sign In form
            </h2>
        </div>
    )
}

export default SignInPage;
